<div class="entities" style="line-height: 2.5; direction: ltr">Inhibition of cyclin-dependent kinases , GSK - 3beta and CK1 by hymenialdisine , a marine sponge constituent . BACKGROUND : Over 2000 protein kinases regulate cellular functions . Screening for inhibitors of some of these kinases has already yielded some potent and selective compounds with promising potential for the treatment of human diseases . RESULTS : The marine sponge constituent hymenialdisine is a potent inhibitor of cyclin-dependent kinases , glycogen synthase kinase - 3beta and casein kinase 1 .

<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">The potential role of bevacizumab in early stages and locally advanced non-small cell lung cancer . Improving outcomes for early-stage non-small cell lung cancer ( NSCLC ) is a major research area considering that a significant percentage of such patients develop recurrent disease within 5 years of complete lung resection . Adjuvant chemotherapy prolongs survival , with an absolute improvement in 5 - year overall survival of about 5 % with drawbacks such as treatment toxicity . Approximately , one third of patients with newly diagnosed NSCLC have locally advanced disease not amenable for surgical resection - in this setting of patients concurrent chemoradiation is the standard of therapy . However , the treatment of locally advanced NSCLC is still controversial and clinical outcomes are disappointing , and so new approaches are required to improve the clinical benefit in this setting of patients . Vascular endothelial growth factor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15692
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) is a key angiogenic factor implicated in tumor blood vessels formation and permeability , and tumor 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15692
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 overexpression in patients with early stage lung cancer has been associated with worse relapse free and overall survival . Several agents have been developed that inhibit 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15692
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 or its receptor signalling system . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00112
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 is the first recombinant humanized monoclonal antibody binding 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15692
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 to demonstrate clinical benefit or rather a survival prolongation in combination with chemotherapy in the treatment of non-squamous advanced NSCLC patients . These positive results led to a large number of clinical trials to evaluate bevacizumab in combination with other targeted agents in advanced disease , and to define the role of this agent in early stage NSCLC such as the impact of bevacizumab integration in chemoradiotherapy strategy for locally advanced disease .</div>

<h2 style="margin: 0">2</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Selective inhibition of the tumor marker

</mark>
 by antiinflammatory N-phenylanthranilic acids and glycyrrhetic acid . A human aldose reductase-like protein , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 rediscovered : the new biology and targeting the androgen receptor therapeutically . Discoveries over the past decade suggest that castration-resistant prostate cancer ( CRPC ) is sensitive , but not resistant to , further manipulation of the androgen-androgen receptor ( AR ) axis . Several new therapies that target this axis have demonstrated clinical activity . In this article , preclinical and clinical findings occurring in the field of AR-targeted therapies are reviewed . Reviews of scientific and clinical development are divided into those occurring prereceptor ( androgen production and conversion ) and at the level of the receptor ( AR aberrations and therapies targeting AR directly ) . Intracrine androgen production and AR amplification , among others , are among the principal aberrancies driving CRPC growth . Phase III data with abiraterone acetate and phase II data with 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #CC9966); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , along with other similar therapies , confirm for the clinician that the scientific findings related to persistent AR signaling in a castrate milieu can be harnessed to produce significant clinical benefit for patients with the disease . Studies aimed at optimizing the timing of their use and exploring the mechanisms of resistance to these therapies are under way . The clinical success of therapies that directly target androgen synthesis as well as the most common aberrancies of the AR confirm that prostate cancer retains dependence on AR signaling , even in the castrate state .</div>

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 plus methotrexate or standard therapy is more effective than methotrexate or standard therapies alone in the treatment of fatigue in patients with active , inadequately treated rheumatoid arthritis . OBJECTIVES : Fatigue is an important systemic symptom of rheumatoid arthritis ( RA ) but has rarely been evaluated consistently after initiation of treatment in RA patients . This study examined the effects of adalimumab ( HUMIRA , Abbott Laboratories , Abbott Park , IL , USA ) , a fully human , anti-tumor necrosis factor ( anti - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) monoclonal antibody , on reducing fatigue in patients with RA . METHODS : A total of 1526 patients with RA were enrolled in 3 randomized , placebo-controlled clinical trials of adalimumab versus placebo plus methotrexate ( MTX ) or placebo plus standard antirheumatic therapies . Fatigue was assessed with the Functional Assessment of Chronic Illness Therapy ( FACIT ) fatigue scale questionnaire ( which has been validated in RA ) at baseline , mid-study , and at the end of the study . Logistic regression models were constructed using baseline demographic variables to test for treatment effect . In addition , sensitivity analyses were performed to determine the robustness of the data . RESULTS : At baseline in the 3 trials , patients ' fatigue ranged from 27.9- 29.7 , representing considerable fatigue on the FACIT fatigue scale . Fatigue was significantly and consistently reduced in adalimumab-treated patients in the 3 clinical trials . Relative to placebo plus MTX , the adalimumab 40 - mg-every-other-week dosage group reported statistically significantly less fatigue at all time points post-baseline . Improvements between adalimumab and placebo ranged from 3-7 points across all 3 trials , with a 3-4- point change representing a minimum clinically important difference . CONCLUSION :

 treatment was shown to significantly reduce fatigue in patients with moderate to severe RA . Changes in fatigue in all 3 trials were found to be clinically important .</div>
